import { Link } from 'react-router-dom';

const ArtistList = (props) => {
      const { artists, selectedArtistsCB } = props;

      const selectArtist = ({ a }) => {
            selectedArtistsCB({ a });
      };

      return (
            <div className='main'>
                  <h2>Artists list</h2>

                  <div>
                        {artists.map((a) => (
                              <ul key={a.id}>
                                    <button onClick={() => selectArtist({ a })}>
                                          <Link to={`/artist/:${a.id}`}>
                                                {a.name}
                                          </Link>
                                    </button>
                              </ul>
                        ))}
                  </div>
            </div>
      );
};

export default ArtistList;
